import { Message } from './utilities/types';

export const messages: Message[] = [
  {
    content: 'ㅋㅋ',
    date: '2108-10-11',
    author: 'user1',
  },
  {
    content: '하이',
    date: '2000-01-01',
    author: 'user4',
  },
  {
    content: '안농',
    date: '1500-12-31',
    author: 'user3',
  },
];

export const messageInput: string = '입력하는중이에요';
